import { Box, Stack } from "@mui/material";
import TaskAltIcon from '@mui/icons-material/TaskAlt';

import "./CardType.scss";

const CardType = ({ title, subtitle, thumb, handleClick, isSelect=false }) => {
    return (
        <>
            <Box className={isSelect ? "b-card-4 b-card-selected" : "b-card-4"} onClick={handleClick}>
                <Box className="b-icon">
                    <TaskAltIcon style={{ fontSize: 35, color: "#4caf50" }} />
                </Box>
                <Box className="b-thumb">
                    <img src={thumb} alt={title} />
                </Box>
                <Box className="card-front">
                    <Stack>
                        <p className="title">{title}</p>
                        <p className="subtitle">{subtitle}</p>
                    </Stack>
                </Box>
            </Box>
        </>
    )
}

export default CardType;
